import React from 'react'
import './NavigationWeatherForecast.css'
import { NavLink, useLocation } from 'react-router-dom'

export default function NavigationWeatherForecast() {

    let url = useLocation()

    return (
    <nav>
        <ul className='navigation-weather-forecast'>
            <li><NavLink to='//4days'>4 days</NavLink></li>
            <li><NavLink to='//8days'>8 days</NavLink></li>
            <li><NavLink to='//12days'>12 days</NavLink></li>
            <li><NavLink to='//16days'>16 days</NavLink></li>
        </ul>
    </nav>
    )
}

